import React, { FC } from "react";

interface IMainProductImage {
  imageSrc: string;
}

const MainProductImage: FC<IMainProductImage> = ({ imageSrc }) => {
  return (
    <MainImage>
      <div style={{ backgroundImage: `url(${imageSrc})` }} />
    </MainImage>
  );
};

export default MainProductImage;
